import 'bootstrap/dist/css/bootstrap.min.css'
import 'react-bootstrap-table-next/dist/react-bootstrap-table2.min.css';
import 'react-bootstrap-table2-paginator/dist/react-bootstrap-table2-paginator.min.css';

import BootstrapTable from 'react-bootstrap-table-next';
import paginationFactory from "react-bootstrap-table2-paginator";
import { useEffect, useState } from 'react';
import videoProjectServices from './services/videoProjectService';
import { IData } from './interfaces/IData';

export const productsGenerator = (quantity:any) => {
  const items = [];
  for (let i = 0; i < quantity; i++) {
    items.push({ id: i, name: `Item name ${i}`, price: 2100 + i });
  }
  return items;
};

const products = productsGenerator(100);

const columns = [
  {
    dataField: "id",
    text: "Product ID",
    sort: true
  },
  {
    dataField: "name",
    text: "Product Name",
    sort: true
  },
  {
    dataField: "price",
    text: "Product Price"
  }
];

console.log(videoProjectServices.getAll())

function App() {
  const [data, setData] = useState<IData[] | undefined>([])

  useEffect(()=> {
    // setData(videoProjectServices.getAll())
  }, [])

  return (
    <div className="App">
      <h1>Hello</h1>
      <BootstrapTable
        bootstrap4
        keyField="id"
        data={products}
        columns={columns}
        pagination={paginationFactory({ sizePerPage: 5 })}
      />
    </div>
  );
}

export default App;
